//REDUX
import {  Provider  } from 'react-redux';
import store from './store';


export default class App extends Component{
//Provider uses react context to allow any child component to access the store.
    render(){
      return(
        <Provider store={store}>
          <div>
          <MainNavigator />
          <MainSpace />
          </div>
        </Provider>
      );
    }
}

